What is the output of the following Java code? 
```java
public class Main {
 public static void main(String[] args) {
 String s1 = "hello";
 String s2 = new String("hello");
 System.out.println(s1 == s2);
 }
}
```

What is the output of the following C code? 
```c
#include <stdio.h>
int main() {
 int x = 2;
 printf("%d", (x << 1) + (x >> 1));
 return 0;
}
```

What is the output of the following Java code? 
```java
public class Main {
 public static void main(String args[]) {
 int i;
 for (i = 1; i <= 12; i += 2) {
 if (i == 8) {
 System.out.println(i);
 break;
 }
 }
 }
}
```

What is the output of the following C code? 
```c
#include <stdio.h>
int main() {
 int a = 10;
 int *p = &a;
 int **q = &p;
 printf("%d", **q);
 return 0;
}
```

What is the output of the following JavaScript code? 
```javascript
var a = 10 + 20 + "5";
document.getElementById("demo").innerHTML = a;
```

What is the output of the following JavaScript code? 
```javascript
var name = "Alex" + " " + "Alvin";
document.getElementById("demo").innerHTML = name;
```

What is the output of the following C code? 
```c
#include <stdio.h>
int main() {
 int x = 10;
 printf("%d", ~x);
 return 0;
}
```

What is the output of the following C code? 
```c
#include <stdio.h>
int main() {
 int x = 5;
 x = x++ + ++x;
 printf("%d", x);
 return 0;
}
```

What is the output of the following C code? 
```c
#include <stdio.h>
int main() {
 int a = 10, b = 20;
 a = a ^ b;
 b = a ^ b;
 a = a ^ b;
 printf("%d %d", a, b);
 return 0;
}
```
